#!/usr/bin/perl
@remove=qw/6 8 9 10 14 15 16 17 23 27 30 33 41 42 46 70/;
$file=shift @ARGV;
chomp $file;
open(F,$file);
$fo="$file.remcomp.csv";
open(FO,">$fo");
	while($line=<F>){
		$row++;
		print "Processing $row of \t$file\n"; 
		if($row==1){
			for($c=0;$c<=$#remove;$c++){
				$cnt=$c+1;
				@tmp1=split(/\,/,$line);
				for($cc=0;$cc<$#tmp1;$cc++){
					@tmp2=split(/\_/,@tmp1[$cc]);
					if((@tmp2[1]+0)==(@remove[$c]+0)){
						$colmark{$cc}++;
						print "@tmp2[1]\t";
					}
				}
			}
		}
				@tmp1=split(/\,/,$line);
				for($cc=0;$cc<$#tmp1;$cc++){
					if($colmark{$cc} eq ""){
						print FO"@tmp1[$cc]\,";
					}
				}
				print FO"@tmp1[$cc]\n";
	}


__END__
